                });   
            
      

     });  
        
        function dibujatabla2(menu){

         var tabla = '<table  width="100%" id="tblServicio" class="display" >'
        tabla+= '<thead>'+
                '<tr>'+
                   
                     '<th>N. Orden</th>'+
                     '<th>Nombre Cliente</th>'+
                      '<th>Cedula</th>'+
                     '<th>Fecha Ingreso</th>'+
                     '<th>Descripción</th>'+
                 '</tr>'+
              '</thead><tbody>'; 
         
        for (var i in menu) 
        {

          
        
           tabla += '<tr>'
       
          +'<td>'+menu[i].servicios_cliente_id+'</td>'
          +'<td>'+menu[i].Nombre+'</td>'
          +'<td>'+menu[i].cedula+'</td>' 
          +'<td>'+menu[i].fecha_ingreso+'</td>'
          +'<td>'+menu[i].descripcion+'</td></tr>';
          
        }
         
        tabla += '</tbody></table>'

        return tabla;
    }
     
     
});
     
 </script>  
